"""
https://leetcode.com/problems/shortest-bridge/
"""
import sys
sys.setrecursionlimit(10**6)
class Solution:
    def shortestBridge(self, grid: list[list[int]]) -> int:
        count = 1
        points = [[],[]]
        def dfs(x,y):
            if visit[y][x] == 1 or grid[y][x] ==0:
                return
            grid[y][x] = count
            points[count-1].append([x,y])
            for i in range(4):
                xn, yn = x+xs[i], y+ys[i]
                if 0<= xn < n and 0 <= yn < n:
                    visit[y][x] = 1
                    dfs(xn,yn)


        n = len(grid)
        visit = [[0]*n for i in range(n)]
        xs, ys = [1,-1,0,0],[0,0,1,-1]
        
        for i in range(n):
            for j in range(n):
                dfs(i,j)
                if grid[j][i] == 1:
                    count=2
        
        answer = 100
        for firstPoint in points[0]:
            x1,y1 = firstPoint
            for secPoint in points[1]:
                x2,y2 = secPoint
                answer = min(abs(x1-x2) + abs(y1-y2),answer)
        return answer-1
            
